import React from 'react'

function Footer() {
  return (
    <div>
         <footer className="py-4 bg-dark">
                <div className="container">
                    <p className="m-0 text-center text-white">TechKing</p>
                </div>
            </footer>

    </div>
  )
}

export default Footer
